select count(*) as aggregate from (select `bravo_spaces`.* from `bravo_spaces` where `bravo_spaces`.`status` = 'publish' and ( '6371' * acos(
cos( radians('26.8983705') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('80.94910689999999') )
+ sin( radians('26.8983705') ) * sin( radians(map_lat) )
)
) <= '10' and `bravo_spaces`.`deleted_at` is null group by `bravo_spaces`.`id`) as `aggregate_table`

select `bravo_spaces`.* from `bravo_spaces` where `bravo_spaces`.`status` = 'publish' and ( '6371' * acos(
cos( radians('26.8983705') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('80.94910689999999') )
+ sin( radians('26.8983705') ) * sin( radians(map_lat) )
)
) <= '10' and `bravo_spaces`.`deleted_at` is null group by `bravo_spaces`.`id` order by POW((bravo_spaces.map_lng-'80.94910689999999'),2) + POW((bravo_spaces.map_lat-'26.8983705'),2), `is_featured` desc, `id` desc limit 25 offset 0
